Tanks of Fury

War Documentary hosted by Bil Graves, published by Smithsonian Channel in 2014 - English narration


Information
------------------------------

Tanks of Fury
They were out-gunned and out-armored by superior German tanks, but what the American M4 Sherman tank crews lacked in firepower, they made up for in courage. Discover the stories of the heroic GIs who rolled into Nazi territory in the final weeks of WWII and faced off against an enemy that refused to surrender. Then, go behind the scenes of the film &quot;Fury&quot; and inside the tankers' world, as we hear accounts from veterans who survived the intense tank battles firsthand.

